                    url: basedURL + ""/admin/productattributes/attribute-categories?attributeId="" + attributeId,
                    datatype: ""json"",
                    traditional: true,
                    success: function (data) {
                        $(data.data).each(function (index, item) {
                            let catString = ""<span class ='text-label'>"" + item.name + ""</span>"";
