                WriteLiteral(@"ummy_category_list"").append(catString);
                        });

                        if (data.data.length > 0)
                            $("".dummy_toggle_catlist"").removeClass(""d-none"");
                    },
                    error: function (er) {
                        $.notify(""Something is Wrong!"", ""error"");
